import React, { useEffect, useState } from 'react';
import io from 'socket.io-client';

function App() {
  const [message, setMessage] = useState('');

  useEffect(() => {
    const socket = io('http://localhost:5000/ab-metric-data');

    socket.on('connect', () => {
      console.log('Connected to WebSocket server');
      // print data that is emmited from the server
      socket.emit('ab_metric_data', 'Hello from client');
    });

    socket.on('ab_metric_data', (data) => {
      console.log(`Received message: ${data}`);
      setMessage(data);
    });

    socket.on('disconnect', () => {
      console.log('Disconnected from WebSocket server');
    });

    return () => {
      socket.disconnect();
    };
  }, []);

  return (
    <div>
      <h1>WebSocket Example</h1>
      <p>{message}</p>
    </div>
  );
}

export default App;
